import React from "react";

export default class Library extends React.Component {
    constructor(props) {
      super(props);

      this.state = {
        tracks: [],
        searchTerm: "",
        lastSearch: "",
        page: "",
        pages: "",
        isLoading: true
      };
    }
    componentDidMount() {
        const page = 1;
        const search = "";

        fetch(
            `https://chinook-api.herokuapp.com/api/tracks?page=${page}&name=${search}`
        )
            .then((response) => {
            return response.json();
            })
            .then((json) => {
            this.setState({
                tracks: json.data,
                page: json.meta.page,
                pages: json.meta.pages,
                isLoading: false
            });
        });
    }

    render() {
        <>
        <h3>My Library</h3>
        <h1>Help</h1>
        <table>
            <tr>
                <th>Name</th>
                <th>Composer</th>
                <th>Milliseconds</th>
            </tr>
            {this.state.tracks.map((data) => {
                return (
                    <tr key={data.id}>
                    <td>{data.attributes.name}</td>
                    <td>
                        {data.attributes.composer
                        ? data.attributes.composer
                        : "NA"}
                    </td>
                    <td>{data.attributes.milliseconds}</td>
                    </tr>
                );
            })}
        </table>
        </>
    }
}
